import React from "react";
import {Box, Grid, Typography, Button, makeStyles, ThemeProvider } from "@material-ui/core";

const skills = ["Javascript", "React.js", "Node.js"];

const useStyles = makeStyles((theme) => ({
    wrapper: {
        border: "1px solid #e8e8e8",

    },
    
    CompanyName:{
        fontSize: "13.5px",
        backgroundColor: theme.palette.primary.main,
        padding: theme.spacing(0.75),
        borderRadious:"5px",
        display: "inline-block",
        fontWeight:600,
    },

    skillChip:{
        margin: theme.spacing(0.5),
        padding:theme
    }
}));


export default (props) => {
    const classes = useStyles();
    return(
        <Box p ={2} className={classes.wrapper}>
            <Grid container alignItems="center">
                <Grid item xs>
                    <Typography variant="subtitle1"> FrontEnd Developer</Typography>
                    <Typography className = {classes.CompanyName}variant="subtitle2"> Google </Typography>
                </Grid>
                <Grid item container xs>
                    {skills.map((skill) => 
                        (<Grid key={skill} item>
                            {skill}
                        </Grid>
                    ))}
                </Grid>
                <Grid item container direction = "column" alignItems ="flex-end" xs>
                    <Grid item>
                    <Typography variant="caption"> 
                        Hace 1 Mes | Tiempo Completo | Presencial 
                    </Typography>
                </Grid>
                <Grid item>
                    <Box mt={2}>
                    <Button variant="outlined"> Mostrar </Button>
                    </Box>
                </Grid>
            </Grid>
        </Grid>
    </Box>
    )
}
